    "environmental-impact-statement-master-plan-great-dismal-swamp-national-wildlife-refuge-198",nt"isopen":
    false,nt"url": null,nt"notes": "The following report describes the proposed
    master plan for long range management and development of Great Dismal Swamp National
    Wildlife Refuge and compares the proposed plan to other reasonable alternatives.
    This document has been prepared in accordance with appropriate consideration to
    environmental values and amenities in decision making. The purpose of the proposed
    master plan is to provide guidance for managing the lands, waters, and wildlife
    of the Great Dismal Swamp National Wildlife Refuge. Through the planning effort,
    consensus is sought in determining how to perpetuate this dynamic wetland ecosystem
    while accommodating a variety of public uses. Theresulting long-range refuge objectives
    and management strategies should foster sound day-to-day management decisions.",nt"license_title":
